車種別専用カット！ドレスアップに。<br><br><br>●「マジカルカーボン・シリーズ」は炭素繊維素材、及びガラス繊維素材を特殊技術により柔軟性をもたせた国際特許申請済みの純国産の高級カーボンです。<br><br>●平織りカーボンではなく、見る角度によってその表情を変える綾織りカーボンにこだわっています。<br><br>●素材の輝きと光沢を放ちつつ、カーボンの立体感・質感が味わえ、高級感を醸し出しながらエレガンスに仕上がります。<br><br><br>【適合車種】<br>メーカー：MITSUBISHI/ミツビシ<br>車 名：パジェロ<br>型 式：V93W/V97W<br>年 式：2006.10～2008.10<br><br>入数：片側6ピース 左右合計12ピース<br>カラー：ブラック<br>メーカー：ハセプロ<br>品番：CPM-29<br><br><br>※画像のカラーはイメージです。 販売カラーはタイトルのカラーとなります。<style type="text/css">
